import Home from "./Home";
import Yugi from "./Yugi";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Route exact path="/" render={Home} />
      <Route exact path="/Yugi" render={Yugi} />
    </div>
  );
}

export default App;
